import streamlit as st

# 제목 설정
st.title("Layout")
st.divider()

# 사이드바
st.sidebar.header('사이드바 헤더')
number = st.sidebar.slider("사이드바 슬라이더", 0, 100)

# 컬럼 (Columns)
wid = 150
col1, col2, col3, col4 = st.columns(4)
with col1:
    st.image("data:image/jpeg;base64,",
             width = wid)
with col2:
    st.image("data:image/jpeg;base64,",
             width = wid)
with col3:
    st.image("data:image/jpeg;base64,",
             width = wid)
with col4:
    st.image("data:image/jpeg;base64,",
             width = wid)

# 탭 (Tabs)
wid = 500
tab1, tab2, tab3, tab4 = st.tabs(['봄', '여름', '가을', '겨울'])
with tab1:
    st.image("data:image/jpeg;base64,",
             width = wid)
with tab2:
    st.image("data:image/jpeg;base64,",
             width = wid)
with tab3:
    st.image("data:image/jpeg;base64,",
             width = wid)
with tab4:
    st.image("data:image/jpeg;base64,",
             width = wid)

# 확장 패널 (Expander)
with st.expander("여기를 클릭하면 내용이 펼쳐집니다"):
    st.write("확장된 내용이 여기에 표시됩니다.")

# 컨테이너 (Container)
container = st.container()
container.write("이것은 컨테이너 안에 있는 내용입니다.")


